import axios from 'axios';
function Creators(){
    useEffect(()=>{
        axios.get('http://localhost:5001/profilepic')
            .then( res =>{
                console.log(res);
            })
            .catch( err =>{
                console.log(err);
            })
    })
    return (
        <>
        </>
    )
}
export default Creators
